const e=JSON.parse('{"key":"v-2c35d7d1","path":"/publicity/news/ICCAD_contest.html","title":"ICCAD竞赛第一名","lang":"zh-CN","frontmatter":{"title":"ICCAD竞赛第一名","order":2},"headers":[{"level":2,"title":"iEDA团队勇夺2022年ICCAD竞赛第一名","slug":"ieda团队勇夺2022年iccad竞赛第一名","link":"#ieda团队勇夺2022年iccad竞赛第一名","children":[{"level":3,"title":"一、赛事背景","slug":"一、赛事背景","link":"#一、赛事背景","children":[]},{"level":3,"title":"二、赛题解读","slug":"二、赛题解读","link":"#二、赛题解读","children":[]},{"level":3,"title":"三、竞赛历程","slug":"三、竞赛历程","link":"#三、竞赛历程","children":[]},{"level":3,"title":"四、iEDA课题组介绍","slug":"四、ieda课题组介绍","link":"#四、ieda课题组介绍","children":[]}]}],"git":{"createdTime":1719039319000,"updatedTime":1719039319000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":6.63,"words":1988},"filePathRelative":"publicity/news/ICCAD_contest.md","localizedDate":"2024年6月22日","excerpt":"<h2> iEDA团队勇夺2022年ICCAD竞赛第一名</h2>\\n<p>2022年11月3日，在美国加州圣迭哥举行的电子设计自动化领域盛会ICCAD上揭晓了CAD Contest算法竞赛的最终排名。经过数月的激烈角逐，来自鹏城实验室开源EDA课题组的iEDA 3Dplacer团队获得了该项赛事三大赛道之一的第一名。本届CAD Contest@ICCAD算法竞赛共有来自国内外知名高校与研究机构的166支队伍参与，如东京大学、台湾大学、香港中文大学、北京大学、台湾清华大学、德州大学奥斯汀分校、复旦大学等。</p>\\n\\n\\n<h3> 一、赛事背景</h3>\\n<p>电子设计自动化（Electronic Design Automation，EDA）工具是指包括功能设计、逻辑综合、物理设计、仿真验证等一整套自动化芯片设计流程的计算机辅助设计软件。EDA作为集成电路产业链的战略基础支柱之一，积极促进芯片行业的技术革新，极大提升半导体产业效率。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
